// problems_fix_images.js — R1(No.2) image hotfix
// 本ファイルは、令和元年度 No.2 (id: "2019-2") の画像が表示されない問題を修正します。
// 既存の problems_fix_images.js がある場合は、置き換えるか、こちらを後から読み込んでください。
(function(){"use strict";
  var override = {
    "2019-2": "data:image/jpeg;base64,"
  };

  function asArrays(x){
    var out = [];
    if(Array.isArray(x) && x.length && Array.isArray(x[0])) out = out.concat(x);
    else if(Array.isArray(x)) out.push(x);
    return out;
  }

  function apply(){
    var pools = [];
    if (typeof window !== 'undefined') pools = pools.concat(asArrays(window.PROBLEMS_CHUNKS));
    if (typeof PROBLEMS_CHUNKS !== 'undefined') pools = pools.concat(asArrays(PROBLEMS_CHUNKS));

    pools.forEach(function(arr){
      (arr||[]).forEach(function(q){
        if(!q) return;
        var id = String((q.id!=null? q.id : (q.year+'-'+q.number)));
        if(override[id]) q.image = override[id];
        if(q.year===2019 && q.number===2) q.image = override['2019-2'] || q.image; // 念のため
      });
    });
  }

  if (document && document.readyState !== 'loading') apply();
  else if (typeof addEventListener === 'function') addEventListener('DOMContentLoaded', apply);
})();
